export const getAll = () => dispatch => {
  return fetch("/api/Dux")
    .then(resp => resp.json())
    .then(function({ data }) {
      dispatch(actions.getAllCampus(data));
    });
};

export const getOne = payload => dispatch => {
  return fetch(`/api/Dux/${payload}`)
    .then(resp => resp.json())
    .then(function({ data }) {
      dispatch(actions.getCampus(data));
    });
};

export default {
  getAll,
  getOne
};

