} from "../constants/action_constants_for_Campus";

const initialState = {
  CampusList: [],
  isLoading: false,
  SingleCampus: {
    Name: "",
    Quacking: true,
    Ducklings: {},
    Fly2Gether: true
  }
};

export default function Campus_reducer(state = initialState, action) {
  switch (action.type) {
    case GET_ALL_CAMPUS: {
      console.log("hitting get_all_campus");
      return { ...state, CampusList: action.payload };
